import React from "react";
import Headers from "../Header/header";
import Default from "../Main/default";
import Footer from "../Footer/footer";

const Home = () => {
  return (
    <div>
      <Headers />
      <Default />
      <Footer />
    </div>
  );
};

export default Home;
